import React, { useState } from 'react';

const Slider = () => {
  const [currentImage, setCurrentImage] = useState(0);
  const images = [
    'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQp2UUPnVHSZgtVvmO5vzY9fH7pWLyl-8PtwQ&usqp=CAU',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQBHhk7bZREK7nsB5AecENKcN-_hRhlI6355w&usqp=CAU',
    'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSm8ZASDJ_YU520cEt-Hwba7YvQUmhTtxKzaw&usqp=CAU'
  ];

  const nextImage = () => {
    setCurrentImage((currentImage + 1) % images.length);
  };

  const prevImage = () => {
    setCurrentImage((currentImage - 1 + images.length) % images.length);
  };

  return (
    <section className="slider">
      <h1>Welcome to Our Beautiful Landscapes</h1>
      <div className="image-container">
        <img src={images[currentImage]} alt={`Image ${currentImage + 1}`} />
      </div>
      <h1>Капля никотина убивает лошадь, а хомяка разрывает на куски.</h1>
      <button className="previous" onClick={prevImage}>Previous</button>
      <button className="previous" onClick={nextImage}>Next</button>
    </section>
  );
}

export default Slider;
